import { Button , Alert, Container, Carousel } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './LandingPage.css';
import Footer from "./Footer"

function LandingPage () {
    return (
        <div className = 'landingPage'> 
            <body className = 'body'>
                <Container fluid className = "container">
                    <Alert className = 'alert'> Welcome to our Fitness and Nutrition Aggregator !  </Alert>
                    <Alert className = 'alert'> Please precise us if you are a professional user or not. </Alert>
                    <Button className="button" variant="outline-success"> Basic User </Button>
                    <Button className="button" variant="outline-success" > Professional</Button>

                </Container>
            </body>
            <Footer/>
        </div>
     );
}

export default LandingPage;
